import React from "react";
import { styled } from "@mui/material/styles";
import { Box, Container, Grid, List } from "@mui/material";
import Log from "../Home/asset/log.png";

const Logo = styled("img")(({ theme }) => ({
  width: "100px",
  fontSize: "70px",
  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
    width: "100px",
  },
}));

const Con = styled("div")(({ theme }) => ({
  fontFamily: "Roboto",
  fontsSize: "20px",
  fontWeight: 700,
  lineHeight: "26px",
  letterSpacing: "0em",

  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
    display: "none",
  },
}));

const Firstcon = styled("div")(({ theme }) => ({
  fontFamily: "Roboto",
  fontSize: "52px",
  fontWeight: 400,
  lineHeight: "68px",
  letterSpacing: "0em",
  position: "relative",
  top: "100px",

  [theme.breakpoints.down("sm")]: {
    fontFamily: "Roboto",
    fontSize: "26px",
    fontweight: 400,
    lineHeight: "34px",
    letterSpacing: "0em",
    textAlign: "center",
    position: "relative",
    top: "133px",
  },
}));

function Home() {
  return (
    <div>
      <Box
        sx={{
          height: "90px",
          maxWidth: "100%",
          backgroundColor: "red",
        }}
      >
        <Container>
          <Grid
            container
            sx={{
              position: "relative",
              top: "32px",
            }}
          >
            <Grid item xs={12} sm={5}>
              <Logo src={Log}></Logo>
            </Grid>
            <Grid item xs={12} sm={1}></Grid>
            <Grid item xs={12} sm={6}>
              <Con>contuct us</Con>
            </Grid>
          </Grid>
        </Container>
      </Box>
      <Box
        sx={{
          height: "600px",
          maxWidth: "100%",

          backgroundColor: "pink",
        }}
      >
        <Container>
          <Grid container>
            <Grid item xs={12} sm={6}>
              <Firstcon>MANAGEMENT & SERVICES COMPANY</Firstcon>
            </Grid>
            <Grid item xs={12} sm={1}></Grid>
            <Grid item xs={12} sm={5}></Grid>
          </Grid>
        </Container>
      </Box>
    </div>
  );
}

export default Home;
